import '../styles/Modal.css';
function ModalDevice({closeModal}) {
    return (
        <div className='modal'>
            <span id="close" onClick={closeModal}>&times;</span>
            <div className="modal-content">
            <h2>Add device</h2>
                <label>Description:</label>
                <input placeholder="ex: John123"></input>
                <label>Address:</label>
                <input placeholder="ex: John"></input>
                <label>Maximum hourly energy consumption:</label>
                <input placeholder="ex: john@gmail.com"></input>
                <button type='submit'>Add</button>
            </div>
        </div>

    );

}

export default ModalDevice;
